(function () {
  const displacementTexture = 'data:image/png;base64,';
  const svgContainer = Object.assign(document.createElement('div'), {
    id: 'mt-svg-container',
    innerHTML: `
      <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 300 200">
        <defs>
          <filter id="mt-curve" x="-50%" y="-50%" width="200%" height="200%">
             <feImage result="warp" xlink:href="${displacementTexture}" />
             <feDisplacementMap xChannelSelector="G" yChannelSelector="R" in="SourceGraphic" in2="warp" scale="400" />
          </filter>
        </defs>
      </defs>
    `
  });
  document.body.appendChild(svgContainer);

  // Override maketerm.js filter chain
  const css = `
    :root {
      --filter-chain: sepia(90%) hue-rotate(180deg) blur(0.2px) brightness(170%) url(#mt-curve);
    }
  `;

  const style = document.createElement('style');
  style.type = 'text/css';
  if (style.styleSheet) {
    style.styleSheet.cssText = css;
  } else {
    style.appendChild(document.createTextNode(css));
  }
  document.head.appendChild(style);
}());
